import React from 'react';
import './ContentPanel.css';

const PanelC = React.forwardRef((props, ref)=>{

    return (
        <div className='column'>
            <div className='box2' ref={ref}></div> 
            <div className='aboutMe'>About Me</div>
        </div>
    )
}) 
export default PanelC;
